module.exports = "<ion-header>\r\n  <ion-toolbar color=\"danger\">\r\n      <ion-buttons slot=\"start\">\r\n        <ion-back-button></ion-back-button>\r\n      </ion-buttons>\r\n      <ion-title>Política de Privacidad</ion-title>\r\n    </ion-toolbar>\r\n</ion-header>\r\n\r\n<ion-content>\r\n    <h1> Introducción</h1>\r\n    <p>Cuando usas ElEstore, nos confías tu información. Nos\r\n    comprometemos a no defraudar tu confianza. Para ello,\r\n    empezamos por ayudarte a comprender nuestras prácticas\r\n    de privacidad.</p>\r\n\r\n    <p>Esta política describe la información que recopilamos, cómo\r\n    la utilizamos y compartimos, así como las opciones que\r\n    tienes en relación a la misma</p>\r\n\r\n    <p>Última modificación: 21 de septiembre de 2017\r\n    Fecha efectiva: 1 de noviembre de 2017</p>\r\n\r\n   <p> Esta política, siempre y cuando no se indique lo\r\ncontrario a continuación, se aplica a cualquier\r\nusuario de los servicios de Uber o de los de sus\r\nasociados en cualquier parte del mundo, así como\r\na cualquier persona que se ponga en contacto con\r\nUber o le haga llegar información de algún otro\r\nmodo. Esto incluye a cualquiera que use los\r\nservicios de Uber o de sus asociados para:</p>\r\n\r\n<p>Solicitar o recibir transporte (pasajeros)\r\nOfrecer transporte de forma individual o a\r\ntravés de empresas de transporte asociadas\r\n(socios conductores)\r\nSolicitar entregas de comida u otros artículos\r\n(receptores de entrega)\r\nOfrecer servicios de entrega (socios de\r\nentrega)\r\nCualquier otro usuario de los servicios de\r\nUber (incluidas las aplicaciones, sitios web y\r\nAPI de Uber), así como cualquier persona\r\nque se ponga en contacto con Uber o le haga\r\nllegar información de algún otro modo,\r\nexcepto que esté sujeto a un aviso, acuerdo\r\no declaración de privacidad independiente.</p>\r\n\r\n<p>Si vives en los Estados Unidos, el controlador de\r\nlos datos que Uber o sus asociados recopilan o\r\nreciben de ti es:\r\nUber Technologies, Inc.\r\n1455 Market Street\r\nSan Francisco, California, 94103\r\nSi vives fuera de los Estados Unidos, el\r\ncontrolador de los datos es:</p>\r\n<p>Uber B.V.\r\nMr. Treublaan 7, 1097 DP\r\nAmsterdam, the Netherlands</p>\r\n\r\n<p>Uber recopila los siguientes tipos de información:\r\n1. La información que proporcionas,\r\nincluida la información facilitada al:\r\nCrear o actualizar la cuenta de Uber, que\r\ndependiendo de la ubicación y los servicios\r\nde Uber usados puede incluir el nombre,\r\nemail, número de teléfono, nombre de\r\nusuario y contraseña, dirección, información\r\nbancaria o de pago, números de\r\nidentificación gubernamental, fecha de\r\nnacimiento y fotografía\r\nFacilitar información sobre el vehículo o el\r\nseguro (para socios conductores)</p>\r\n\r\n<p>Solicitar servicios a través de una aplicación\r\no sitio web Uber\r\nPonerse en contacto con Uber, incluyendo\r\ncasos de asistencia al cliente\r\nPonerse en contacto con otros usuarios de\r\nUber a través de nuestros servicios\r\nCompletar las encuestas que recibes de Uber\r\no en nombre de la empresa\r\nHabilitar características que requieren el\r\nacceso de Uber' a la libreta de direcciones o\r\nal calendario</p>\r\n\r\n<p>2. La información que se crea al usar nuestros\r\nservicios,\r\nlo que incluye:\r\nInformación de ubicación\r\nDependiendo de los servicios de Uber que\r\nuses y las configuraciones de la aplicación o\r\npermisos de tu dispositivo, Uber puede\r\nrecopilar la información de ubicación exacta\r\no aproximada tal como se determina a\r\ntravés de la información del GPS, la\r\ndirección IP y conexión Wi-Fi.\r\nSi eres conductor o socio de entrega,\r\nUber recopila información de ubicación\r\nmientras la aplicación Uber se ejecuta\r\nen primer plano (la aplicación está\r\nabierta y aparece en pantalla) o en\r\nsegundo plano (la aplicación está\r\nabierta pero no aparece en pantalla).</p>\r\n\r\n<p>Si eres pasajero, Uber puede\r\nrecopilar información de\r\nubicación cuando la aplicación\r\nUber se ejecuta en primer plano.\r\nEn determinadas zonas, Uber\r\ntambién puede recopilar esta\r\ninformación cuando la aplicación\r\nUber se ejecuta en segundo\r\nplano si la configuración de la\r\naplicación o los permisos del\r\ndispositivo permiten esta\r\nrecopilación</p>\r\n\r\n<p>Uber recopile la información de\r\nubicación. No obstante, esto\r\npuede afectar la funcionalidad\r\ndisponible de la aplicación Uber.\r\nPor ejemplo, si no permites que\r\nUber recopile la información de\r\nubicación, tendrás que introducir\r\nmanualmente la dirección de\r\nrecogida. Además, la información\r\nde ubicación se recopilará del\r\nsocio conductor durante el viaje,\r\nincluso si no has permitido que\r\nUber la recopile.</p>\r\n\r\n<p>Información de transacción\r\nRecopilamos los detalles de transacción\r\nrelacionados con el uso de nuestros\r\nservicios, incluyendo el tipo de servicio que\r\nha solicitado u ofrecido, la fecha y hora en el\r\nque este se ofreció, el importe cobrado, la\r\ndistancia recorrida y otros detalles de\r\ntransacción relacionados. Adicionalmente, si\r\nalguien usa tu código promocional, podemos\r\nasociar tu nombre con esa persona.</p>\r\n\r\n<p>Información del dispositivo\r\nInformación de preferencia y uso\r\nRecopilamos información sobre la manera en\r\nla que interactúas con nuestros servicios, las\r\npreferencias expresadas y la configuración\r\nelegida. En algunos casos lo hacemos a\r\ntravés del uso de cookies, contadores de\r\nvisitas («pixel tags») y otras tecnologías\r\nsimilares que crean y mantienen\r\nidentificadores únicos. Para saber más sobre\r\nesta tecnologías, lee nuestro Resumen sobre\r\ncookies.</p>\r\n\r\n<p>Información del dispositivo\r\nPodemos recopilar información sobre los\r\ndispositivos que usas para acceder a\r\nnuestros servicios, incluyendo el modelo de\r\ndispositivo, el sistema operativo y su\r\nversión, el software, los nombres de archivo\r\ny su versión, los idiomas de preferencia, los\r\nidentificadores de dispositivo únicos\r\nInformación de registro\r\nAl interactuar con nuestros servicios,\r\nrecopilamos los registros de servidor, que\r\npueden incluir información como la dirección\r\nIP del dispositivo, la fecha y hora de acceso,\r\nlas características de la aplicación o las\r\npáginas visitadas, los fallos de aplicación y\r\notra actividad de sistema, el tipo de\r\nnavegador y el sitio o servicio de terceros\r\nque usabas antes de interactuar con\r\nnuestros servicios.</p>\r\n\r\n<p>Llamadas y mensajes de texto\r\nPermitimos a los usuarios que se llamen o se\r\nmanden mensajes de texto los unos a los\r\notros a través de las aplicaciones Uber. Por\r\nejemplo, en algunos países permitimos que\r\nlos socios conductores y los pasajeros, así\r\ncomo los socios y receptores de entrega, se\r\nllamen o se manden mensajes sin publicar\r\nsus números de teléfono. Para ofrecer este\r\nservicio, Uber recibe algunos detalles\r\nrelativos a las llamadas o mensajes,\r\nincluyendo la fecha y hora de la llamada o\r\nmensaje, y el contenido del mismo. Uber\r\ntambién puede utilizar esta información para\r\nservicios de asistencia al cliente (incluyendo\r\nla resolución de disputas entre usuarios), con\r\nfines de seguridad y protección, y para usar\r\nen analíticas.</p>\r\n\r\n<p>Libreta de direcciones e información del\r\ncalendario\r\nSi permites que la aplicación Uber tenga\r\nacceso a la libreta de direcciones del\r\ndispositivo, podemos recopilar nombres e\r\ninformación de contacto de la libreta para\r\nfacilitar la interacción social a través de\r\nnuestros servicios y para otros fines\r\ndescritos en esta declaración o en el\r\nmomento de consentimiento o recopilación.\r\nSi permites que la aplicación Uber tenga\r\nacceso al calendario del dispositivo,\r\nrecopilamos información como el título</p>\r\n\r\n<p>z3. Información de otras fuentes\r\nAquí se incluyen:\r\nUsuarios que realizan comentarios, como\r\nvaloraciones o felicitaciones.\r\nSocios empresariales de Uber a través de los\r\nque creas o accedes a la cuenta de Uber,\r\ncomo por ejemplo proveedores de pagos,\r\nservicios de redes sociales, servicios de\r\nmúsica por encargo o aplicaciones o sitios\r\nweb que usen las API de Uber o cuyas API\r\nuse Uber\r\nCompañías aseguradoras (si eres socio\r\nconductor o socio de entrega)\r\nProveedores de servicios financieros (si eres\r\nsocio conductor o de entrega)\r\nEmpresas de transporte asociadas (si eres un\r\nsocio conductor que usa nuestros servicios a\r\ntravés de una cuenta asociada con dicha\r\nempresa)\r\nEl titular de un perfil de Uber para Empresas\r\no UberFamilia que utilices\r\nFuentes públicas disponibles\r\nProveedores de servicios de marketing\r\nUber puede combinar la información recopilada de\r\nestas fuentes con otra información de la que ya\r\ndisponga</p>\r\n\r\n<p>Uber utiliza la información recopilada para los\r\nsiguientes fines, entre otros:</p>\r\n\r\n<p>1. Ofrecer servicios y características\r\ninformación para:\r\nPermitir el transporte, entrega y otros\r\nservicios\r\nProcesar o facilitar los pagos para dichos\r\nservicios\r\nOfrecer, obtener, proporcionar o facilitar\r\ncobertura de seguros o soluciones\r\nfinancieras relacionadas con nuestros\r\nservicios\r\nHabilitar características que permiten\r\ncompartir información con otras personas,\r\ncomo por ejemplo al publicar una felicitación\r\nsobre un socio conductor, recomendar Uber\r\na un amigo, dividir una tarifa o compartir la\r\nhora estimada de llegada.</p>\r\n\r\nHabilitar características para personalizar la\r\ncuenta de Uber, como por ejemplo al crear\r\nmarcadores para tus lugares favoritos\r\nLlevar a cabo operaciones internas\r\nnecesarias para ofrecer nuestros servicios,\r\nincluyendo la resolución de problemas de\r\nsoftware y problemas de funcionamiento, la\r\ninvestigación, prueba y análisis de datos, y\r\nla supervisión y análisis de las tendencias de\r\nactividad y uso.\r\n2. Seguridad y protección\r\nUtilizamos la información para ayudar a mantener\r\nla seguridad, protección e integridad de nuestros\r\nservicios. Por ejemplo, recopilamos información de\r\nlos dispositivos de los socios conductores para\r\nidentificar comportamientos de conducción\r\npeligrosos, como la velocidad o las frenadas y\r\naceleraciones bruscas, y para sensibilizar a los\r\nsocios conductores sobre estos comportamientos.\r\nEsto también incluye, por ejemplo, nuestra\r\ncaracterística de Verificación de ID en tiempo\r\nreal, que indica a los socios conductores que\r\ncompartan un selfie antes de conectarse. Esto\r\nayuda a garantizar que el socio conductor que usa\r\nla aplicación se corresponde con la cuenta de Uber\r\nque tenemos registrada, evitando fraudes.\r\n\r\nUber utiliza la información recopilada (incluyendo\r\nlas grabaciones de las llamadas de asistencia al\r\ncliente después de avisar sobre ello y recibir el\r\nconsentimiento correspondiente) para ayudarte\r\ncuando te pones en contacto con nuestros\r\nservicios de asistencia al cliente, por ejemplo para:\r\nRemitir tus preguntas al encargado de\r\nasistencia al cliente apropiado\r\nInvestigar y tratar los problemas\r\nSupervisar y mejorar nuestras respuestas de\r\nasistencia al cliente\r\n4. Investigación y desarrollo\r\nPodemos utilizar la información recopilada para\r\npruebas, investigaciones, análisis y desarrollos de\r\nproducto. Esto nos permite mejorar y aumentar la\r\nseguridad y protección de nuestros servicios,\r\ndesarrollar nuevas características y productos, y\r\nfacilitar la cobertura de seguros y soluciones\r\nfinancieras relacionadas con nuestros servicios.\r\n5. Comunicaciones entre los usuarios\r\nUber utiliza la información recopilada para\r\npermitir las comunicaciones entre nuestros\r\nusuarios. Por ejemplo, un socio conductor puede\r\nmandar un mensaje o llamar a un pasajero para\r\nconfirmar una ubicación de recogida, o un\r\nrestaurante o socio de entrega puede llamar a un\r\nreceptor de entrega con información sobre su\r\npedido.\r\n6. Comunicaciones de Uber\r\nUber puede utilizar la información recopilada para\r\nponerse en contacto contigo sobre productos,\r\nservicios, promociones, estudios, encuestas,\r\nnoticias, actualizaciones y eventos. También puede\r\nutilizar esta información para promocionar y\r\nprocesar concursos y sorteos, cumplir con los\r\npremios correspondientes y brindarte anuncios y\r\ncontenidos relevantes sobre nuestros servicios y\r\nlos de nuestros socios empresariales. De la misma\r\nforma, también puede utilizarla para informar\r\nsobre elecciones, votaciones, referendos y otros\r\nprocesos de política.\r\nPodemos utilizar la información recopilada para\r\ninvestigar o abordar demandas o disputas\r\nrelacionadas con el uso de los servicios de Uber, o\r\nen la medida en que lo permita la legislación\r\nvigente.\r\n\r\nLas cookies son pequeños archivos de texto\r\nalmacenados en el navegador o dispositivo por los\r\nsitios web, aplicaciones, medios en línea y\r\nanuncios. Uber utiliza las cookies y tecnologías\r\nsimilares para fines como:\r\nAutentificar usuarios\r\nRecordar las preferencias y la configuración\r\ndel usuario\r\nDeterminar la popularidad del contenido\r\nEntregar y medir la efectividad de las\r\ncampañas publicitarias\r\nAnalizar la tendencia y el tráfico del sitio y,\r\nen general, entender los comportamientos en\r\nlínea y los intereses de las personas que\r\ninteractúan con nuestros servicios\r\nTambién podemos permitir que otros proporcionen\r\nservicios de medición y analítica de audiencia para\r\nnosotros, publiquen anuncios en nuestro nombre a\r\ntravés de Internet y que rastreen e informen sobre\r\nlos resultados de estos anuncios. Estas entidades\r\npueden usar cookies, balizas web, kits de\r\ndesarrollo de software (los SDK por sus siglas en\r\ninglés) y otras tecnologías que sirvan para\r\nidentificar el dispositivo utilizado al visitar\r\nnuestro sitio web y usar nuestros servicios, así\r\ncomo al visitar otros sitios y servicios en línea.\r\n\r\nlas opciones que tienes relacionadas con estas\r\ntecnologías.\r\n\r\nUber puede compartir la información recopilada:\r\n1. Con otros usuarios\r\nPor ejemplo, si eres pasajero, podemos\r\ncompartir el nombre, la valoración media de\r\npasajero dada por los socios conductores y\r\nlas ubicaciones de recogida o destino con los\r\nsocios conductores. Si compartes un\r\nuberPOOL con otro pasajero, le\r\ncomunicaremos al otro pasajero tu nombre y\r\npodrá ver tu ubicación de recogida o\r\ndestino.\r\nSi eres socio conductor o socio de entrega,\r\ncompartiremos información con tus\r\npasajeros como, por ejemplo, el nombre y la\r\nfotografía; la marca, el modelo, el color, el\r\nnúmero de matrícula y la fotografía de su\r\nvehículo; localización; la puntuación media\r\nproporcionada a través de las votaciones de\r\nlos pasajeros; y la información de contacto\r\n(conforme a lo establecido en las leyes\r\naplicables). Si eliges completar un perfil del\r\nconductor, también podemos compartir\r\ncualquier tipo de información asociada con\r\ndicho perfil, incluyendo información que\r\npresentes y felicitaciones que pasajeros\r\nanteriores han presentado sobre ti. El\r\npasajero o receptor de entrega también\r\nrecibirá un recibo que contenga determinada\r\ninformación, como un desglose del importe\r\ncobrado el nombre una fotografía el mapa\r\n2. Cuando tú lo solicites\r\nEsto incluye compartir información con:\r\nOtras personas cuando lo solicites. Por\r\nejemplo, si lo solicitas, podemos compartir la\r\nhora estimada de llegada y la ubicación con\r\nun amigo o la información del viaje cuando\r\ndivides la tarifa con un amigo.\r\nSocios empresariales de Uber. Por ejemplo, si\r\nhas solicitado un servicio a través de una\r\ncolaboración u oferta promocional hecha por\r\nun tercero, Uber puede compartir la\r\ninformación con estos terceros. Esto puede\r\nincluir, por ejemplo, otras aplicaciones o\r\nsitios web que se integran con nuestras API\r\no servicios, o aquellos con una API o servicio\r\ncon los que nos integramos, o socios\r\nempresariales con los que Uber pueda\r\nasociarse para ofrecer una promoción, un\r\nconcurso o un servicio especializado.\r\n3. Con el público general cuando publiques\r\ncontenido en un foro público\r\nNos encanta escuchar a nuestros usuarios, incluso\r\na través de foros públicos como los blogs de Uber,\r\nredes sociales, y determinadas características de\r\nnuestra red. Cuando te comunicas con nosotros a\r\ntravés de estos canales, dichas comunicaciones\r\npueden ser accesibles para el público.\r\n4. Con el titular de cuentas de Uber que puedas\r\nusar\r\nSi usas un perfil asociado a otra parte, podemos\r\ncompartir la información del viaje con el titular de\r\ndicho perfil. Esto ocurre, por ejemplo, si eres:\r\nUn pasajero que usa el perfil de Uber para\r\nEmpresas de su jefe\r\nUn socio conductor que usa una cuenta\r\npropiedad de una empresa de transporte\r\nasociada\r\nUn pasajero que efectúa un viaje organizado\r\npor un amigo o por un perfil familiar\r\n\r\n2. Cuando tú lo solicites\r\nEsto incluye compartir información con:\r\nOtras personas cuando lo solicites. Por\r\nejemplo, si lo solicitas, podemos compartir la\r\nhora estimada de llegada y la ubicación con\r\nun amigo o la información del viaje cuando\r\ndivides la tarifa con un amigo.\r\nSocios empresariales de Uber. Por ejemplo, si\r\nhas solicitado un servicio a través de una\r\ncolaboración u oferta promocional hecha por\r\nun tercero, Uber puede compartir la\r\ninformación con estos terceros. Esto puede\r\nincluir, por ejemplo, otras aplicaciones o\r\nsitios web que se integran con nuestras API\r\no servicios, o aquellos con una API o servicio\r\ncon los que nos integramos, o socios\r\nempresariales con los que Uber pueda\r\nasociarse para ofrecer una promoción, un\r\nconcurso o un servicio especializado.\r\n3. Con el público general cuando publiques\r\ncontenido en un foro público\r\nNos encanta escuchar a nuestros usuarios, incluso\r\na través de foros públicos como los blogs de Uber,\r\nredes sociales, y determinadas características de\r\nnuestra red. Cuando te comunicas con nosotros a\r\ntravés de estos canales, dichas comunicaciones\r\npueden ser accesibles para el público.\r\n4. Con el titular de cuentas de Uber que puedas\r\nusar\r\nSi usas un perfil asociado a otra parte, podemos\r\ncompartir la información del viaje con el titular de\r\ndicho perfil. Esto ocurre, por ejemplo, si eres:\r\nUn pasajero que usa el perfil de Uber para\r\nEmpresas de su jefe\r\nUn socio conductor que usa una cuenta\r\npropiedad de una empresa de transporte\r\nasociada\r\nUn pasajero que efectúa un viaje organizado\r\npor un amigo o por un perfil familiar\r\n\r\n8. Con tu consentimiento\r\nUber puede compartir la información con terceros\r\nque no sean los descritos en esta declaración si\r\nrecibimos tu consentimiento tras mandar una\r\nnotificación.\r\n\r\n</ion-content>\r\n"

